import numpy as np
import pandas as pd
import sklearn.datasets
from sklearn.preprocessing import StandardScaler
from sklearn.model_selection import train_test_split

dataset = sklearn.datasets.load_breast_cancer()

print(dataset)

#loading the data in a pandas dataFrame
df = pd.DataFrame(dataset.data, columns=dataset.feature_names)

df.head()

df.shape

X = df
Y = dataset.target

print(X)

print(Y)

"""Lets say most of the mean radis is between 10 to 30 but one is 1000. It is called outlayer and it creates problem."""

X_train, X_test, Y_train, Y_test = train_test_split(X, Y, test_size=0.2, random_state=3)

print(X.shape, X_train.shape, X_test.shape)

"""Now lets standardize the data"""

#standard deviation
print(dataset.data.std())

"""If we had all the values in the same range the std would have been close to 1."""

scalar = StandardScaler()

"""Learn more about how this works from here - https://scikit-learn.org/stable/modules/generated/sklearn.preprocessing.StandardScaler.html"""

scalar.fit(X_train)

X_train_stded = scalar.transform(X_train)

print(X_train_stded)

X_test_stded = scalar.transform(X_test)

print(X_test_stded)

print(X_train_stded.std())

print(X_test_stded.std())

