"""### Handeling Imbalanced data"""

#Importing the deps
import pandas as pd
import numpy as np

data = pd.read_csv('/content/credit_data.csv')

data.tail()

data['Class'].value_counts()

"""As we can see in the class atribute there is 120k+ 0 values
and only 259 of 1 values...
So the data set is not balanced

Here

0 = Legit Transaction

1 = Fraud Transaction
"""

legit = data[data.Class == 0]
fraud = data[data.Class == 1]

print(legit.shape)
print(fraud.shape)

"""Under-sampling = creating a sample data containing similer distribution"""

legit_sample = legit.sample(n=259)

"""Let's add the two now data frames"""

credit_data = pd.concat([legit_sample, fraud], axis=0)

credit_data.shape

credit_data['Class'].value_counts()

"""As we can see now 0 and 1 have similer distributiion. if we use this data now to do some ML it will give us better results.

### Feature Extraction

mapping from textual data to real values vectors

BOW = Bag of words = number of unique words in the text collection

TF-IDF = Term Frequency = number of times a word appared in the collection

IDF = - Inverse Document Frequency = log(N/n) ,  where N = the number of documents, n = the number of documwent in which the term t has appared on.

*** The IDF of a rare word is high and IDF of a frequent word is low

TF-IDF value of a term = TF x IDF
"""

