import numpy as np
import pandas as pd
import re
import nltk
from nltk.corpus import stopwords
from nltk.stem.porter import PorterStemmer
from sklearn.feature_extraction.text import TfidfVectorizer
from sklearn.model_selection import train_test_split

nltk.download('stopwords')

"""Stopwords are words that repeat a lots of time in a paragraph (in a normal situation )"""

print(stopwords.words('english'))

news = pd.read_csv('/content/train.csv')

news.head()

"""0 = Real news

1 = Fake news
"""

news.shape

"""Checking for missing values"""

news.isnull().sum()

"""replacing null values with empty strings"""

news = news.fillna('')

"""merging the author and title"""

news['content'] = news['author']+' '+news['title']

print(news['content'])

news.head()

"""Separating feature and target"""

X = news.drop(columns='label', axis=1)
Y = news['label']

print(X)

print(Y)

"""Stemming = process the keywords into root words

Ex: working, worked, worker -> work
"""

def stemming(content):
  stemmed_content = re.sub('[^a-zA-Z]',' ',content)
  stemmed_content = stemmed_content.lower()
  stemmed_content = stemmed_content.split()
